-- ----------------------------
-- Procedure structure for insert_big_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `insert_big_data`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_big_data`(IN START INT(10), IN max_num INT(10))
BEGIN
DECLARE i INT DEFAULT 0;
SET autocommit=0;
REPEAT
SET i=i+1;
VALUES((START+i), CONCAT('tony',i),RAND()*90,'传智播客大数据量记录测试');
UNTIL i = max_num
END REPEAT;
COMMIT;
    END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for sp_customer
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_customer`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_customer`(IN START INT(10), IN max_num INT(10))
BEGIN
DECLARE i INT DEFAULT 0;
SET autocommit=0;
REPEAT
SET i=i+1;
VALUES((START+i), CONCAT('tony',i),RAND()*90,'传智播客大数据量记录测试');
UNTIL i = max_num
END REPEAT;
COMMIT;
   
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for sp_del_contract
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_del_contract`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_del_contract`(IN p_contract_id VARCHAR(40))
BEGIN
/*删除指定货物下的附件信息*/
DELETE FROM ext_cproduct_c WHERE contract_product_id IN (SELECT contract_product_id FROM contract_product_c WHERE contract_id=p_contract_id);
/*删除指定合同下的货物信息*/
DELETE FROM contract_product_c WHERE contract_id=p_contract_id;
/*删除指定的合同*/
DELETE FROM contract_c WHERE contract_id=p_contract_id;
COMMIT;
    
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for sp_del_export
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_del_export`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_del_export`(IN p_export_id VARCHAR(40))
BEGIN
/*删除指定货物下的附件信息*/
DELETE FROM ext_eproduct_c WHERE export_product_id IN (SELECT export_product_id FROM export_product_c WHERE export_id=p_export_id);
/*删除指定报运下的货物信息*/
DELETE FROM export_product_c WHERE export_id=p_export_id;
/*删除指定的报运*/
DELETE FROM export_c WHERE export_id=p_export_id;
COMMIT;
    
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `tri_del_contract_product`;
DELIMITER ;;
CREATE TRIGGER `tri_del_contract_product` BEFORE DELETE ON `contract_c` FOR EACH ROW BEGIN
	DELETE FROM contract_product_c WHERE contract_id=old.contract_id;
    END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `tri_del_ext_cproduct`;
DELIMITER ;;
CREATE TRIGGER `tri_del_ext_cproduct` BEFORE DELETE ON `contract_product_c` FOR EACH ROW BEGIN
	DELETE FROM ext_cproduct_c WHERE contract_product_id=old.contract_product_id;
    END
;;
DELIMITER ;
